                        var orderDetailsData = {
                            OrderId: orderResponse.orderId,
                            ProductId: orderData.ProductId,
                            UnitPrice: orderData.UnitPrice,
                            Quantity: orderData.Quantity,
                            Discount: orderData.Discount
